import React from "react";
import { Link } from "react-router-dom";
import logo from "../Assets/logo.png";

//This is for the navigation bar.This include logo,links to main pages and user profile
const Navbar = () => {
  return (
    <div className="z-50 flex items-center justify-between w-screen bg-emerald-400/40">
      {/* Logo  */}
      <div className="flex mx-6 ml-16">
        <Link to={"/"}>
          <img className="h-12" src={logo} alt="" />
        </Link>
      </div>

      {/* Links for main pages */}
      <div className="flex justify-between w-[30%] text-lg font-semibold text-white">
        <Link to={"/"}>Home</Link>
        <Link to={"/service"}>Services</Link>
        <Link to={"/contact-us"}>Contact Us</Link>
        <Link to={"/about-us"}>About Us</Link>
      </div>

      {/* User profile */}
      <div className="flex items-center justify-center w-10 h-10 mx-6 mr-16 text-2xl text-white rounded-full ring-2 ring-white">
        <i class="fa-solid fa-user"></i>
      </div>
    </div>
  );
};

export default Navbar;
